import React from "react";
import "../scss/components/Empty.css";
const Empty = () => {
  return (
    <div>
      <div className="login-hp">
      <button class="btn-59">
        <span>Button</span>
        <a href="/login">
        </a>
        </button>
        </div>

      <h1>
        <span>C</span>
        <span>H</span>
        <span>A</span>
        <span>T</span>
        <span>T</span> 
        <span>U</span>
        <span>R</span>
        <span>B</span>
        <span>O</span>
      </h1>
    </div>
  );
};

export default Empty;
